import React from 'react';


import './style.css';

export default function FriendList({img, txt, isFriend}) {
    return (
            <div className="Friend-Chat" >
                <img src={img} alt="" />
                <span>{txt}</span>
                {isFriend &&
                    <div>
                        <Close/>
                    </div>
                }
            </div>
    );
}
